import { TextField } from "@mui/material";

const Login = () => {
  return (
    <div>
      <div>
        <p class="text-blueLight text-4xl">로그인</p>
        <p>
          계정을 가지고 있지 않으신가요?
          <a href="/signup" class="text-blueDark">
            회원가입
          </a>
          을 진행해주세요
        </p>

        <TextField id="standard-basic" label="Standard" variant="standard" />
      </div>
    </div>
  );
};
export default Login;
